<!DOCTYPE html>
<html>
  <head>
  	<meta charset="utf-8" />
  	<title>Compare species maps</title>
 	<style>	
 	.mydivicon{
		width: 12px
		height: 12px;
		border-radius: 10px;
		/* background: #408000; */
		background: #8000FF; 
		border: 1px solid #fff;
		opacity: 0.5
	}	  
    </style>

    <!-- jquery -->
    <script src="jquery-1.11.2.min.js" type="text/javascript"></script>
    
    <!-- leaflet -->
	<link rel="stylesheet" href="leaflet-0.7.3/leaflet.css" />
	<script src="leaflet-0.7.3/leaflet.js" type="text/javascript"></script>
	
	<script src="turf.min.js"></script>

	
	<script>
		var map1, map2, map3;
		var geojson1, geojson2, geojson3 = null;
		
		// http://gis.stackexchange.com/a/116193
		// http://jsfiddle.net/GFarkas/qzdr2w73/4/
		var icon = new L.divIcon({className: 'mydivicon'});		

		//--------------------------------------------------------------------------------
		function onEachFeature(feature, layer) {
			// does this feature have a property named popupContent?
			if (feature.properties && feature.properties.popupContent) {
				//console.log(feature.properties.popupContent);
				// content must be a string, see http://stackoverflow.com/a/22476287
				layer.bindPopup(String(feature.properties.popupContent));
			}
		}	
			
		//--------------------------------------------------------------------------------
		function create_maps() {
			map1 = new L.Map('map1');
			map2 = new L.Map('map2');
			map3 = new L.Map('map3');

			// create the tile layer with correct attribution
			var osmUrl='http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png';
			var osmAttrib='Map data Â© <a href="http://openstreetmap.org">OpenStreetMap</a> contributors';
			var osm1 = new L.TileLayer(osmUrl, {minZoom: 1, maxZoom: 12, attribution: osmAttrib});		

			map1.setView(new L.LatLng(0, 0),4);
			map1.addLayer(osm1);	
			
			var osm2 = new L.TileLayer(osmUrl, {minZoom: 1, maxZoom: 12, attribution: osmAttrib});	
			map2.setView(new L.LatLng(0, 0),4);
			map2.addLayer(osm2);	
			
			var osm3 = new L.TileLayer(osmUrl, {minZoom: 1, maxZoom: 12, attribution: osmAttrib});	
			map3.setView(new L.LatLng(0, 0),4);
			map3.addLayer(osm3);		
				
		}
		
		//--------------------------------------------------------------------------------
		function clear_maps() {
			if (geojson1) {
				map1.removeLayer(geojson1);
			}
			
			if (geojson2) {
				map2.removeLayer(geojson2);
			}	
			
			if (geojson3) {
				map3.removeLayer(geojson2);
			}			
					
		}	
		
		//--------------------------------------------------------------------------------
		function add_data(map, data) {
		
			geojson = L.geoJson(data, { 

			pointToLayer: function (feature, latlng) {
                return L.marker(latlng, {
                    icon: icon});
            },			
			style: function (feature) {
				return feature.properties && feature.properties.style;
			},
			onEachFeature: onEachFeature,
			}).addTo(map);
			
			// Open popups on hover
  			geojson.on('mouseover', function (e) {
    			e.layer.openPopup();
  			});
  			
  			var features = [];
  			
  			if (data.features) {
  				features = data.features;
  			} else {
  				features.push(data);
  			}
  			
  			for (var k in features) {
  			
  				//console.log(JSON.stringify(features[k], null, 2));
				
				if (features[k].geometry.type) {
					if (features[k].geometry.type == 'Polygon') {
						for (var i in features[k].geometry.coordinates) {
						  minx = 180;
						  miny = 90;
						  maxx = -180;
						  maxy = -90;
				  
						  for (var j in features[k].geometry.coordinates[i]) {
							minx = Math.min(minx, features[k].geometry.coordinates[i][j][0]);
							miny = Math.min(miny, features[k].geometry.coordinates[i][j][1]);
							maxx = Math.max(maxx, features[k].geometry.coordinates[i][j][0]);
							maxy = Math.max(maxy, features[k].geometry.coordinates[i][j][1]);
						  }
						}					
						bounds = L.latLngBounds(L.latLng(miny,minx), L.latLng(maxy,maxx));
						
					}
					if (features[k].geometry.type == 'MultiPoint') {
						minx = 180;
						miny = 90;
						maxx = -180;
						maxy = -90;				
						for (var i in features[k].geometry.coordinates) {
							minx = Math.min(minx, features[k].geometry.coordinates[i][0]);
							miny = Math.min(miny, features[k].geometry.coordinates[i][1]);
							maxx = Math.max(maxx, features[k].geometry.coordinates[i][0]);
							maxy = Math.max(maxy, features[k].geometry.coordinates[i][1]);
						}
					
						bounds = L.latLngBounds(L.latLng(miny,minx), L.latLng(maxy,maxx));
					}
					
					if (features[k].geometry.type == 'MultiPolygon') {
					     minx = 180;
						 miny = 90;
						 maxx = -180;
						 maxy = -90;
						for (var m in features[k].geometry.coordinates) {
					
							for (var i in features[k].geometry.coordinates[m]) {
							  for (var j in features[k].geometry.coordinates[m][i]) {
								minx = Math.min(minx, features[k].geometry.coordinates[m][i][j][0]);
								miny = Math.min(miny, features[k].geometry.coordinates[m][i][j][1]);
								maxx = Math.max(maxx, features[k].geometry.coordinates[m][i][j][0]);
								maxy = Math.max(maxy, features[k].geometry.coordinates[m][i][j][1]);
							  }
							}					
							
						}	
						bounds = L.latLngBounds(L.latLng(miny,minx), L.latLng(maxy,maxx));					
					}
					
				}
			}	
			map.fitBounds(bounds);	    					
		}		
	

	</script>
    
    <script>
        //--------------------------------------------------------------------------------
		// http://stackoverflow.com/a/11407464
		$(document).keypress(function(event){

			var keycode = (event.keyCode ? event.keyCode : event.which);
			if(keycode == '13'){
				$('#find').click();   
			}

		});    
	
		//http://stackoverflow.com/a/25359264
		$.urlParam = function(name){
			var results = new RegExp('[\?&]' + name + '=([^&#]*)').exec(window.location.href);
			if (results==null){
			   return null;
			}
			else{
			   return results[1] || 0;
			}
		}    
	
        //--------------------------------------------------------------------------------
		// http://stackoverflow.com/a/16976927
		function ObjectLength_Modern( object ) {
			return Object.keys(object).length;
		}

		function ObjectLength_Legacy( object ) {
			var length = 0;
			for( var key in object ) {
				if( object.hasOwnProperty(key) ) {
					++length;
				}
			}
			return length;
		}


		 
	
	</script>    
	
	<script>
	function add_geojson(label) {
		var data  =  $('#' + label).val();
		
		switch (label) {
			case 'geojson1':
				if (geojson1) {
					map1.removeLayer(geojson1);
				}			
			
			
				geojson1 = JSON.parse(data);
				//console.log(JSON.stringify(geojson1, null, 2));
				add_data(map1, geojson1);
				break;
				
			case 'geojson2':
				if (geojson2) {
					map2.removeLayer(geojson2);
				}			
			
				geojson2 = JSON.parse(data);
				//console.log(JSON.stringify(geojson1, null, 2));
				add_data(map2, geojson2);
				
				compare_maps();
				break;
				
			default:
				break;
		}
	}
	
	
	function compare_maps() {
			
			var points =  []		
			for (var i in geojson2.features) {
				if (geojson2.features[i].geometry.type == 'Point') {
//					console.log(JSON.stringify(geojson2.features[i].geometry.coordinates));
					points.push(turf.point(geojson2.features[i].geometry.coordinates));
				}
			}	
			var pts = turf.featureCollection(points);
			
			// IUCN polygon(s)
			var searchWithin = turf.featureCollection(geojson1.features);
			
			//console.log('pts=' + JSON.stringify(pts, null, 2));
			
			
			
			// GBIF points
			var ptsWithin = turf.within(pts, searchWithin);	
			//console.log('ptsWithin' + JSON.stringify(ptsWithin, null, 2));
			
			var html = ptsWithin.features.length + ' of ' + points.length + ' points within polygon';
			
			$('#points_within').html(html);
			
			add_data(map3, geojson1);
			add_data(map3, ptsWithin);
	

	
	}
	
	
	</script>
